//List.js  创建路由路径
import React from "react";
import { Route, Switch } from "react-router-dom";
function ITPage() {
  //相匹配的component
  return (
    <div style={{ width: "500px" }}>
      <span>IT</span>
    </div>
  );
}
function ReactPage() {
  return (
    <div style={{ width: "500px" }}>
      <span>React</span>
    </div>
  );
}
function RouterPage() {
  return (
    <div style={{ width: "500px" }}>
      <span>Router</span>
    </div>
  );
}

function List() {
  return (
    <Switch>
      <Route exact path="/it">
        <ITPage />
      </Route>
      <Route exact path="/react">
        <ReactPage />
      </Route>
      <Route exact path="/router">
        <RouterPage />
      </Route>
    </Switch>
  );
}
export default List;
